const CreateTask = ({ createTaskHandler }) => {
  return (
    <div>
      <form onSubmit={createTaskHandler}>
        <input
          type="text"
          name="task"
          id="task"
          placeholder="Wash the dishes"
        />
      </form>
      <button></button>
    </div>
  );
};

export default CreateTask;
